import React, { Component } from "react";
import Launch from "./Launch";

class List extends Component {
  state = {
    launches: []
  };

  render() {
    return (
      <div>
        {this.state.launches.map(launch => (
          <Launch data={launch} />
        ))}
      </div>
    );
  }
}

export default List;
